import "./App.css";
import Formulario from "./componentes/formulario.jsx";
import Boton from "./componentes/boton";
import Agregados from "./componentes/agregados";
import { useState } from "react";
import React from 'react';

function App() {
  const [pass,_] = useState("252525");
  const [valPass, setValPass] = useState(false);

  return (
    <body>
      <div className="container">
        <form>
          <Formulario registro={pass} contraseña={setValPass} />

          {valPass ? <Boton /> : null}
        </form>
        <div className="drops">
          <Agregados />
        </div>
      </div>
    </body>
  );
}

export default App;
